import React, { useEffect } from 'react';
import $ from 'jquery';
import Header from './components/Header';
import HomePage from './components/HomePage';
import Espansioni from './components/Espansioni';
import InfoCards from './components/InfoCards';
import Background from './components/Background';
import Footer from './components/Footer';
import './assets/css/index.css';
import image1 from './assets/images/image1.png';
import image2 from './assets/images/image2.png';
import image3 from './assets/images/image3.png';
import image4 from './assets/images/image4.png';
import image5 from './assets/images/image5.png';
import image6 from './assets/images/image6.png';
import image7 from './assets/images/image7.png';
import image8 from './assets/images/image8.png';
import image13 from './assets/images/image13.png';
import image14 from './assets/images/image14.png';
import image16 from './assets/images/image16.png';

const App = () => {
  useEffect(() => {
    const handleScroll = () => {
      const anime = document.querySelectorAll('.animeX');
      anime.forEach(el => {
        const windowHeight = window.innerHeight;
        const elementTop = el.getBoundingClientRect().top;
        const animePoint = 150;

        if (elementTop < windowHeight - animePoint) {
          el.classList.add('active');
        } else {
          el.classList.remove('active');
        }
      });
    };

    window.addEventListener('scroll', handleScroll);

    const $cards = $(".card");
    const $style = $(".hover");

    $cards.on("mousemove", function (e) {
      const $card = $(this);
      const l = e.offsetX;
      const t = e.offsetY;
      const h = $card.height();
      const w = $card.width();
      const lp = Math.abs(Math.floor(100 / w * l) - 100);
      const tp = Math.abs(Math.floor(100 / h * t) - 100);
      const bg = `background-position: ${lp}% ${tp}%;`
      const style = `card.active::before { ${bg} }`
      $cards.removeClass("active");
      $card.addClass("active");
      $style.html(style);
    }).on("mouseout", function () {
      $cards.removeClass("active");
    });

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <>
     <div className="bg">
        <div className="bubbles">
          <span style={{ '--i': 11, backgroundImage: `url(${image1})` }}></span>
          <span style={{ '--i': 12, backgroundImage: `url(${image2})` }}></span>
          <span style={{ '--i': 24, backgroundImage: `url(${image3})` }}></span>
          <span style={{ '--i': 10, backgroundImage: `url(${image4})` }}></span>
          <span style={{ '--i': 14, backgroundImage: `url(${image5})` }}></span>
          <span style={{ '--i': 23, backgroundImage: `url(${image6})` }}></span>
          <span style={{ '--i': 18, backgroundImage: `url(${image7})` }}></span>
          <span style={{ '--i': 16, backgroundImage: `url(${image8})` }}></span>
          <span style={{ '--i': 19, backgroundImage: `url(${image3})` }}></span>
          <span style={{ '--i': 20, backgroundImage: `url(${image1})` }}></span>
          <span style={{ '--i': 22, backgroundImage: `url(${image1})` }}></span>
          <span style={{ '--i': 25, backgroundImage: `url(${image1})` }}></span>
          <span style={{ '--i': 18, backgroundImage: `url(${image13})` }}></span>
          <span style={{ '--i': 21, backgroundImage: `url(${image14})` }}></span>
          <span style={{ '--i': 13, backgroundImage: `url(${image16})` }}></span>
          <span style={{ '--i': 15, backgroundImage: `url(${image4})` }}></span>
          <span style={{ '--i': 26, backgroundImage: `url(${image1})` }}></span>
